import React from 'react';
import {GoogleMap, withScriptjs, withGoogleMap} from "react-google-maps";

function Map(){
  return(
    <GoogleMap 
      defaultZoom = {10} 
      defaultCenter = {{lat: 45, lng: -75}}
    />
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

export default function App(){
  return(
    <div>
      <WrappedMap />
    </div>
  );
}
